import react from 'react';
import cx from 'classnames'
import Head from 'next/head'

// import layouts
import ContentLayout from '../../components/layouts/ContentLayout'
import ContentFragment from '../../components/layouts/ContentFragment'
import ContentContainer from '../../components/layouts/ContentContainer'
import TravelLayout from '../../components/layouts/TravelLayout'

//import components
import ContentHead from '../../components/shared/ContentHead'

//import data
import data from '../../public/static/data/TravelDestinations/krabi'

//React Reveal Animation
import Fade from 'react-reveal/Fade';

//global styles can be found at ../styles/main.scss
//import specific styling module
import aboutStyles from '../styles/about.module.scss';

class Krabi extends react.Component {

    render() {
        const project = workData.academicProjects.rpi
        return (
            <TravelLayout>
                <ContentContainer>
                    {/* Insert Fragments Here */}
                    <ContentFragment title={project.title}
                        time={project.time} text={project.intro}>

                        <div className="row">
                            <div className={cx("rowPhotoPortrait", "intro1")}></div>
                            <div className={cx("rowPhotoLandscape", "intro2")}></div>
                            <div className={cx("rowPhotoPortrait", "intro1")}></div>
                        </div>
                    </ContentFragment>
                    <ContentFragment subtitle="Main Development"
                        text={project.main}>

                        <div className="row">
                            <div className={cx("rowPhotoLandscape", "main1")}></div>
                            <div className={cx("rowPhotoLandscape", "main2")}></div>
                        </div>
                    </ContentFragment>
                </ContentContainer>
                <style jsx>{`
                     .intro1 {
                        background-image: url('/static/images/travel/krabi/intro1.png');
                    }

                    .intro2 {
                        background-image: url('/static/images/travel/krabi/intro2.png');
                    }

                    .main1 {
                        background-image: url('/static/images/travel/krabi/main1.png');
                    }

                    .main2 {
                        background-image: url('/static/images/travel/krabi/main2.png');
                    }
                `}</style>
            </TravelLayout>
        )
    }
}
export default Krabi;
